import React, { Component } from 'react'

export default class MainBar extends Component {
    render() {
        return (
            <section className="main_bar">
                <h1>NBA</h1>
                <div>LOGO</div>
                <div>Players</div>
                <div>Games</div>
            </section>
        )
    }
}
